import React, { useEffect, useState } from 'react';
import api from '../utils/api';
import FileViewer from '../components/FileViewer';

const AdminPanel = () => {
  const [campaigns, setCampaigns] = useState([]);

  useEffect(() => {
    const fetchAll = async () => {
      try {
        const res = await api.get('/campaign/all');
        setCampaigns(res.data);
      } catch (err) {
        console.error('Error loading campaigns');
      }
    };
    fetchAll();
  }, []);

  const updateStatus = async (id, status) => {
    try {
      if (status === 'approved') {
        await api.patch(`/campaign/${id}/approve`);
      } else if (status === 'rejected') {
        await api.patch(`/campaign/${id}/reject`);
      }
      setCampaigns(campaigns.map(c => c._id === id ? { ...c, status } : c));
    } catch {
      alert('Failed to update status');
    }
  };

  return (
    <div className="p-8 max-w-7xl mx-auto bg-white rounded-lg shadow-lg">
      <h1 className="text-4xl font-extrabold mb-6 text-gray-900">Admin Panel</h1>
      {campaigns.length === 0 ? (
        <p className="text-gray-600 text-lg">No campaigns found.</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200 border border-gray-300 rounded-lg">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">User</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Email</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Goal</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Actions</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Files</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {campaigns.map((c) => (
                <tr key={c._id} className="hover:bg-gray-50">
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">{c.fullName}</td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{c.email}</td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">${c.goalAmount}</td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm">
                    <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${
                      c.status === 'approved' ? 'bg-green-100 text-green-800' :
                      c.status === 'rejected' ? 'bg-red-100 text-red-800' :
                      'bg-yellow-100 text-yellow-800'
                    }`}>
                      {c.status}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm">
                    <button onClick={() => updateStatus(c._id, 'approved')} className="bg-green-600 hover:bg-green-700 text-white px-3 py-1 rounded mr-2 transition duration-150">Approve</button>
                    <button onClick={() => updateStatus(c._id, 'rejected')} className="bg-red-600 hover:bg-red-700 text-white px-3 py-1 rounded transition duration-150">Reject</button>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap space-y-1">
                    <FileViewer fileUrl={`http://localhost:5000/api/uploads/${c.files.idDoc}`} fileName="ID Document">ID</FileViewer>
                    <FileViewer fileUrl={`http://localhost:5000/api/uploads/${c.files.billDoc}`} fileName="Utility Bill">Bill</FileViewer>
                    <FileViewer fileUrl={`http://localhost:5000/api/uploads/${c.files.campaignDoc}`} fileName="Campaign Doc">Doc</FileViewer>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default AdminPanel;
